import React from 'react';
import './Experience.css';

function Experience() {
  const experience = [
    {
      Company: 'Hyper tech global technologies Pvt ltd', 
      Position: 'Front End Developer', 
      Location: 'Remote', 
      Duration: ' March 2024 - july-2024', 
      Summery: `<li><ul> Built user-friendly websites and web applications using React.js.<ul/>
      <ul> Ensured the web applications were responsive and worked well on different devices.<ul/><li/>`,
      Project: 'https://www.hypertechglobaltechnologies.com/'
    },
    { Company: ' Hexolt Life Solutions pvt. ltd', Position: ' Front End Developer Intern', Location: 'Nagpur,Maharashtra', Percentage: 'Nov 2023 - Feb 2024', Summery: '' },
  ];
  return (
    <section id='expeience' className='experience'>
      <div className='container expeience-me'>
        <div className='heading-wrapper'>
          <h2>Experience</h2>
        </div>

        <div className='row'>
          <div className='row experience-content'>
            {experience.map((exe, index) => (
              <div key={index} className='col-lg-12 experience-item'>
                <h4>{exe.degree}</h4>
                <p><strong></strong> {exe.Company}</p>
                <p><strong>Position : </strong> {exe.Position}</p>}
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  )
}

export default Experience
